description:
नेपाली कांग्रेसले काठमाडौं-५ मा महामन्त्री प्रदीप पौडेललाई उम्मेदवार बनाएको छ ।&amp;nbsp;

कांग्रेस संसदीय बोर्डले पौडेललाई काठमाडौं-५ को टिकट दिएको हो ।&amp;nbsp;

यसअघि गत निर्वाचनमा एमाले नेता ईश्वर पोखरेललाई पराजित गर्दै सोही क्षेत्रबाट निर्वाचित

काठमाडौँ । सञ्चार तथा सूचना प्रविधिमन्त्री जगदिश खरेलले पदबाट राजीनामा दिएका छन् ।

ललितपुर-२ बाट प्रतिनिधिसभा सभा निर्वाचन लड्ने निश्चित भएपछि खरेलले प्रधानमन्त्री सुशीला कार्कीलाई राजीनामा पत्र बुझाएका हुन् ।&amp;nbsp;

